	/**
	 * XXX : not sure about order of dimensions...
	 */
	public long[][] toPolyLibArray() {
		JNIISLMatrix islIneq = getInequalityMatrix(JNIISLDimType.isl_dim_set,
				JNIISLDimType.isl_dim_param, JNIISLDimType.isl_dim_div,
				JNIISLDimType.isl_dim_cst);

		JNIISLMatrix islEq = getEqualityMatrix(JNIISLDimType.isl_dim_set,
				JNIISLDimType.isl_dim_param, JNIISLDimType.isl_dim_div,
				JNIISLDimType.isl_dim_cst);

		if (islEq.getNbCols() != islIneq.getNbCols())
			throw new RuntimeException();

		int rows = islEq.getNbRows() + islIneq.getNbRows();
		int cols = islEq.getNbCols();

		long[][] tab = new long[rows][cols + 1];

		for (int i = 0; i < islIneq.getNbRows(); i++) {
			tab[i][0] = 1;
			for (int j = 0; j < cols; j++) {
				tab[i][j + 1] = islIneq.getElementVal(i, j).asLong();
			}
		}

		for (int i = islIneq.getNbRows(); i < islIneq.getNbRows()
				+ islEq.getNbRows(); i++) {
			tab[i][0] = 0;
			for (int j = 0; j < cols; j++) {
				tab[i][j + 1] = islIneq.getElementVal(i - islIneq.getNbRows(), j).asLong();
			}

		}
		return tab;
	}

	/**
	 * keeps only one given dimension (pos) of the given dimension type
	 * 
	 * @param type
	 * @param pos
	 * @return
	 */
	public JNIISLBasicSet projectIn(JNIISLDimType type, int pos) {
		int nbdims = (int) this.getSpace().getNbDims(type);
		if (pos < 0 || pos >= nbdims)
			throw new IllegalArgumentException();
		JNIISLBasicSet res = this;
		if (pos + 1 <= nbdims - 1)
			res = res.projectOut(type, pos + 1, nbdims - pos - 1);
		if (pos - 1 >= 0)
			res = res.projectOut(type, 0, pos);
		return res;
	}
